VALUES ('4019839835208', 'Sucre De Bouleau - Birkenzucker - 300 g - Raab', 'édulcorant xylitol (E 967) Le sucre de bouleau (xylitol) est un substitut du qui a en apparence la saveur et la douceur comparable au sucre de table classique. Son nom vient de la dé- couverte des fibres riches en nutriments de l\'écorce de bouleau. Il est cependant produit à partir de maïs sans OGM. contrairement au sucre de table, le sucre de bouleau apporte environ 40% de calories en moins. Le sucre de bouleau a un faible indice glycémique de 7 (70 pour le sucre de table). Le sucre de bouleau est particulièrement favorable pour les dents. Contrairement au sucre, le xylitol ne peut être métabolisé par les bactéries de la flore buccale. Le de bouleau est présent naturellement dans de nom breux fruits, baies et légumes. Il apparaît également Petite quantité dans le métabolisme du glucose. Le de bouleau est idéal pour la pâtisserie (sauf levain) la Indication : Une consommation excessive peut avoir des effetns laxatifs. Une alimentation et mode de vie sain sont d\'une grande importance Boite réutilisable. À conserver au frais, au sec et bien fermee de remplissaq raisons techniques', 'https://static.openfoodfacts.org/images/products/401/983/983/5208/front_fr.9.400.jpg', '0', '0', '100', '0', '0', '0', '0', '0', '', '1');

