VALUES ('4022381501187', 'Rundkornreis', 'Rundkornreis, natur aus biodynamischer Erzeugung (demeter) Mindestens haltbar bis: siehe seitlicher Aufdruck. Kann Spuren von Sesam enthalten. Bitte kühl und trocken lagern. Unser SPIELBERGER Naturreis stammt von einem Demeter- Gut im Piemont, Norditalien. Die Umstellung des Betriebs auf biodynamsche Landwirtschaft vor über 25 Jahren wurde in enger Abstimmung und Beratung durch Hans Spielberger durchgeführt. Zubereitung: Den Reis in der doppelten Menge Wasser etwas quellen lassen. Danach im kochenden, leicht gesalzenen Wasser einmal aufkochen und gut 40 Min. zugedeckt kôcheln lassen. Brown rice, round From biodynamic production (demeter) Best before: see imprint. Store cool and dry.', 'https://static.openfoodfacts.org/images/products/402/238/150/1187/front_fr.4.400.jpg', '1.9', '0.1', '77.4', '1.2', '', '7.5', '0.02', '0.0078740157480315', '', '1');

